import React, { Component } from 'react';
import './App.css';
import {Route, Link} from 'react-router-dom'
import axios from 'axios'

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      headlines: []
    }
  }

  getData = async () => {
    try {
      const response = await axios(`https://api.nytimes.com/svc/search/v2/articlesearch.json?q=tariffs&api-key=S4G7oWgRSHAPBeUzDtI4hi6a31G82Bno
      `, {headers: {"Content-Type": 'text/json', "Access-Control-Allow-Origin": "*"}})
      console.log(response.data)
      this.setState({
        headline: response.data.response.docs.headline
      })
      console.log(this.state.headline)
    }
    catch (error) {
      console.log(error)
    }
  }

  componentDidMount() {
    this.getData()
  }

  render() {
    return (
      <div className="App">
        <h1>Hey</h1>
      </div>
    );
  }
}

export default App;
